import React from 'react';
import './Nav.scss';
function Navbar() {
  return (
    <nav>
      <div>
        Good worm Gardens
      </div>
      <ul>
        <li>Home</li>
        <li>Connect Yards</li>
        <li>Gardening Guide</li>
        <li>Co-ordinators</li>
        <li>Contact Us</li>
      </ul>
    </nav>
  )
};
export default Navbar;
